import React from 'react';
import { useParams } from 'react-router-dom'
import { data } from '../shared/ListOfDoctors'

export default function Worksheet(){
    return(
    <table style={{color: 'white'}}>
        <th>Monday</th>
        <th>Tuesday</th>
        <th>Wednesday</th>
        <th>Thursday</th>
        <th>Friday</th>
        <th>Saturday</th>
        <th>Sunday</th>
    </table>
    )
}
